pragma solidity ^0.5.0;

import "./DEXReserve.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/ownership/Ownable.sol";

/// @title DEX
/// @notice The DEX contract stores the reserves for each token pair and
/// provides functions for interacting with them:
///   1) the view-function `calculateReceiveAmount` for calculating how much
///      the user will receive in exchange for their tokens
///   2) the function `trade` for executing a swap. If one of the tokens is the
///      base token, this will only talk to one reserve. If neither of the
///      tokens are, then the trade will settle across two reserves.
///
/// The DEX is ownable, allowing a DEX operator to register new reserves.
/// Once a reserve has been registered, it can't be updated.
contract DEX is Ownable {event __CoverageDEX(string fileName, uint256 lineNumber);
event __FunctionCoverageDEX(string fileName, uint256 fnId);
event __StatementCoverageDEX(string fileName, uint256 statementId);
event __BranchCoverageDEX(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageDEX(string fileName, uint256 branchId);
event __AssertPostCoverageDEX(string fileName, uint256 branchId);

    mapping (address=>DEXReserve) public reserves;
    address public baseToken;

    event LogTrade(address _src, address _dst, uint256 _sendAmount, uint256 _recvAmount);

    /// @param _baseToken The reserves must all have a common base token.
    constructor(address _baseToken) public {emit __FunctionCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',1);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',26);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',1);
baseToken = _baseToken;
    }

    /// @notice Allow anyone to recover funds accidentally sent to the contract.
    function recoverTokens(address _token) external onlyOwner {emit __FunctionCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',2);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',31);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',2);
ERC20(_token).transfer(msg.sender, ERC20(_token).balanceOf(address(this)));
    }

    /// @notice The DEX operator is able to register new reserves.
    /// @param _erc20 The token that can be traded against the base token.
    /// @param _reserve The address of the reserve contract. It must follow the
    ///        DEXReserve interface.
    function registerReserve(address _erc20, DEXReserve _reserve) external onlyOwner {emit __FunctionCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',3);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',39);
        emit __AssertPreCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',1);
emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',3);
require(reserves[_erc20] == DEXReserve(0x0), "token reserve already registered");emit __AssertPostCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',1);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',40);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',4);
reserves[_erc20] = _reserve;
    }

    /// @notice The main trade function to execute swaps.
    /// @param _to The address at which the DST tokens should be sent to.
    /// @param _src The address of the token being spent.
    /// @param _dst The address of the token being received.
    /// @param _sendAmount The amount of the source token being traded.
    function trade(address _to, address _src, address _dst, uint256 _sendAmount) public returns (uint256) {emit __FunctionCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',4);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',49);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',5);
uint256 recvAmount;
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',50);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',6);
if (_src == baseToken) {emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',2,0);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',51);
            emit __AssertPreCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',3);
emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',7);
require(reserves[_dst] != DEXReserve(0x0), "unsupported token");emit __AssertPostCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',3);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',52);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',8);
recvAmount = reserves[_dst].buy(_to, msg.sender, _sendAmount);
        } else {emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',9);
emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',2,1);if (_dst == baseToken) {emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',4,0);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',54);
            emit __AssertPreCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',5);
emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',10);
require(reserves[_src] != DEXReserve(0x0), "unsupported token");emit __AssertPostCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',5);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',55);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',11);
recvAmount = reserves[_src].sell(_to, msg.sender, _sendAmount);
        } else {emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',4,1);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',57);
            emit __AssertPreCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',6);
emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',12);
require(reserves[_src] != DEXReserve(0x0) && reserves[_dst] != DEXReserve(0x0), "unsupported token");emit __AssertPostCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',6);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',58);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',13);
uint256 intermediteAmount = reserves[_src].sell(address(this), msg.sender, _sendAmount);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',59);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',14);
ERC20(baseToken).approve(address(reserves[_dst]), intermediteAmount);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',60);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',15);
recvAmount = reserves[_dst].buy(_to, address(this), intermediteAmount);
        }}
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',62);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',16);
emit LogTrade(_src, _dst, _sendAmount, recvAmount);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',63);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',17);
return recvAmount;
    }

    /// @notice A read-only function to estimate the amount of DST tokens the
    /// trader would receive for the send amount.
    /// @param _src The address of the token being spent.
    /// @param _dst The address of the token being received.
    /// @param _sendAmount The amount of the source token being traded.
    function calculateReceiveAmount(address _src, address _dst, uint256 _sendAmount) public      returns (uint256) {emit __FunctionCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',5);

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',72);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',18);
if (_src == baseToken) {emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',7,0);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',73);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',19);
return reserves[_dst].calculateBuyRcvAmt(_sendAmount);
        }else { emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',7,1);}

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',75);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',20);
if (_dst == baseToken) {emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',8,0);
emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',76);
            emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',21);
return reserves[_src].calculateSellRcvAmt(_sendAmount);
        }else { emit __BranchCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',8,1);}

emit __CoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',78);
        emit __StatementCoverageDEX('/home/susruth/ren/renvm-demo/ethereum-contracts/contracts/DEX.sol',22);
return reserves[_dst].calculateBuyRcvAmt(reserves[_src].calculateSellRcvAmt(_sendAmount));
    }
}

